import React, { useEffect, } from "react";
import { Tree, PopupProduct } from "../";
import { useSelector, useDispatch } from "react-redux";
import {
  treeAsync,
  selectProducts,
} from "./AppSlice";

export const App = () => {
  const products = useSelector(selectProducts);
  const dispatch = useDispatch();

  useEffect(() => {
    dispatch(treeAsync());
  }, [dispatch]);

  return (
    <>
      <section>
        <Tree
          tree={products}
          expanded={true}
        />  
      </section>
      <PopupProduct />
    </>
  );
};
